                                        {selectedBuyRent === "Buy" && (
                                            <div className="col-12 col-md-4 col-lg-3">
                                                <div className="form-group">
                                                    <select
                                                        className="form-control"
                                                        id="PropertyType"
                                                        value={selectedPropertyType}
                                                        onChange={handlePropertyTypeChange}
                                                    >
                                                        <option value="">Property Type</option>
                                                        {propertyTypes
                                                            .filter((type) => type.name !== "Rental")
                                                            .map((type) => (
                                                                <option key={type.id} value={type.name}>
                                                                    {type.name}
                                                                </option>
                                                            ))}
                                                    </select>
                                                </div>
                                            </div>
                                        )}

                                        {/* Sub Type Select */}
                                        {/* {(selectedBuyRent === "Rent" || (selectedBuyRent === "Buy" && selectedPropertyType)) && (
                                            <div className="col-12 col-md-4 col-lg-3">
                                                <div className="form-group">
                                                    <select className="form-control" id="SubType">
                                                        <option>Sub Type</option>
                                                        {subTypes.map((subType, index) => (
                                                            <option key={index} value={subType}>
                                                                {subType}
                                                            </option>
                                                        ))}
                                                    </select>
                                                </div>
                                            </div>
                                        )} */}

                                        {/* Sub Type Select */}
                                        {(selectedBuyRent === "Rent" || (selectedBuyRent === "Buy" && selectedPropertyType)) && (
                                            <div className="col-12 col-md-4 col-lg-3">
                                                <div className="form-group">
                                                    <select
                                                        className="form-control"
                                                        id="SubType"
                                                        value={selectedSubType}
                                                        onChange={(e) => setSelectedSubType(e.target.value)}
                                                    >
                                                        <option>Sub Type</option>
                                                        {subTypes.map((subType, index) => (
                                                            <option key={index} value={subType}>
                                                                {subType}
                                                            </option>
                                                        ))}
                                                    </select>
                                                </div>
                                            </div>
                                        )}


                                        {/* Min Price Input */}
                                        <div className="col-12 col-md-4 col-lg-3">
                                            <div className="form-group">
                                                <input
                                                    type="number"
                                                    className="form-control"
                                                    id="minprice"
                                                    placeholder="Min Price"
                                                    value={minPrice}
                                                    onChange={(e) => setMinPrice(e.target.value)}
                                                />
                                            </div>
                                        </div>

                                        {/* Max Price Input */}
                                        <div className="col-12 col-md-4 col-lg-3">
                                            <div className="form-group">
                                                <input
                                                    type="number"
                                                    className="form-control"
                                                    id="maxprice"
                                                    placeholder="Max Price"
                                                    value={maxPrice}
                                                    onChange={(e) => setMaxPrice(e.target.value)}
                                                />
                                            </div>
                                        </div>

                                        {/* BHK Select */}
                                        {(selectedBuyRent === "Buy" && selectedPropertyType=="Residential") && (
                                            <div className="col-12 col-md-4 col-lg-3">
                                                <div className="form-group">
                                                    <select
                                                        className="form-control"
                                                        id="bhk"
                                                        value={selectedBHK}
                                                        onChange={(e) => setSelectedBHK(e.target.value)}
                                                    >
                                                        <option value="BHK">BHK</option>
                                                        <option value="1">1BHK</option>
                                                        <option>2BHK</option>
                                                        <option>3BHK</option>
                                                        <option>4BHK</option>
                                                        <option>5BHK</option>
                                                    </select>
                                                </div>
                                            </div>
                                        )}


                                    </div>
                                </form>
                            </div>
                        </div>
                    </div>
                </div>
